 # 1. 两数之和

## 题目

给定一个整数数组 nums 和一个目标值 target，请你在该数组中找出和为目标值的那 两个 整数，并返回他们的数组下标。

你可以假设每种输入只会对应一个答案。但是，数组中同一个元素不能使用两遍。

示例:

给定 nums = [2, 7, 11, 15], target = 9

因为 nums[0] + nums[1] = 2 + 7 = 9
所以返回 [0, 1]

## 题解

### 哈希表

遍历数组，用哈希表保存每个元素对应的索引，遍历的时候检查是否存在 `target - nums[i]` 的键存在，存在的话返回对应的索引

```js
/**
 * @param {number[]} nums
 * @param {number} target
 * @return {number[]}
 */
var twoSum = function(nums, target) {
  let m = new Map();
  for (let i = 0; i < nums.length; ++i) {
    let t = target - nums[i];
    if (m.has(t)) {
      return [m.get(t), i];
    } else {
      m.set(nums[i], i);
    }
  }
  return [];
};
```

时间复杂度：O(n)
空间复杂度：O(n)
